(886, 'বাংলাদেশ, জাপান, চীন ও ভারত', '2017-03-21', '২০১৬', 'প্রি-ক্লিনার ২ টি,ক্ষমতা প্রতি ঘন্টায় ২৫-৩০ মে,টন প্রতিটি।\nক্লিনার-০১ টি,  ক্ষমতা প্রতি ঘন্টায় ২৫-৩০ মে.টন।\n', 'পার-বয়েলিং ইউনিট ২ টি, হাড়ি বড় ৩২ টি, মোট ধারণ ক্ষমতা ১২৮.০০০ মে.টন।', 'ড্রায়ার ৪ টি, ধারণ ক্ষমতা ২০০.০০০ মে.টন।', 'মিলিং ইউনিট ১ টি, মোট ছাঁটাই ক্ষমতা প্রতি ঘন্টায় ১৫-২০.০০০ মে.টন।', 'মিলিং মেশিনারিজ ১ সেট। \nক্লিনার ১ টি, ডিস্টোনার ১ টি, শেলার ৩ টি, প্যাডি সেপারটর ২ টি, হোয়াটনার ৩ টি, রাইস গ্রেডার ১ টি, সিল্কি পলিশার ৩ টি, কালার সর্টার  ২ টি, লেংথ গ্রেডার ১ টি, হাসকর ৩ টি, ফ্লো স্কেল ২ টি, পেডি সাইলোর বিন ১২ টি, ব্যাগিং মেশিন ৩ টি,', 'ধান/চাল সংরক্ষণ গুদাম ঘরের মোট ধারণ ক্ষমতা ১০০০০ মে.টন। ওয়ে ব্রীজ (ডিজিটাল) ক্ষমতা ৬০ মে.টন', ' ট্রান্সফরমার ক্যাপাসিটি', '', '০', '০', ' সেকশন লোড/ মটরের ক্ষমতা', '', '০', '০', ' বয়লারের ক্ষমতা', '', '০', '০', ' 	ধান চাল সংরক্ষনে গুদাম ঘরের ক্ষমতা', '', '০', '০', ' ধান সংগ্রাহক বিনের ক্ষমতা', '', '০', '০', 'পারবয়েলিং ইউনিট', '', '০', '০', ' 	ড্রায়ার', '', '০', '০', '  	শেলার', '', '০', '০', '  	ক্লিনার', '', '০', ' ০', ' পাথর পৃথকীকরণ (Destoner) ইউনিটের ক্ষমতা ', '', '০', '০', ' ধান পৃথকীকরন (Paddy Seperator) ইউনিটের ক্ষমতা', '', '০', '', ' খুদকুড়া পৃথকীকরণ (Thickness grader)ইউনিটের ক্ষমতা', '', '০', '', '  	চাল উজ্জ্বল (Silky) ইউনিটের ক্ষমতা', '', '০', '০', ' চাল গ্রেডিং (Length Grader) ইউনিটের ক্ষমতা', '০', '০', '০', '  	পৃথকীকরণ (Rotary Shifter) ইউনিটের ক্ষমতা', '', '', '', ' চাল মসৃনকরণ (polisher) ইউনিটের ক্ষমতা', '', '', '', ' কালার সর্টার ইউনিটের ক্ষমতা', '', '', '', ' ', '', '', '', 'বস্তাবন্দি করনের ক্ষমতা', ''),
